import { createBrowserRouter } from "react-router-dom";
import App from "./App";
import Authentication from './pages/Authentication';
import ProfileStudent from './pages/ProfileStudent'
import EditStudentPage from './pages/EditStudentPage';
import ChooseTeacher from "./pages/ChooseTeacher";
import CreateRequest from "./pages/CreateRequest";
import GenerateApplicaton from "./pages/GenerateApplicaton";
import MethodRecommendations from "./pages/MethodRecommendations";
import FormMarksCompletion from "./pages/FormMarksCompletion";
import ProfileTeacher from "./pages/ProfileTeacher";
import EditTeacherPage from "./pages/EditTeacherPage";
import EditThemeListTeacher from "./pages/EditThemeListTeacher";

const tableData = [
  {
    theme: "Автоматизация госудраственной итоговой аттестации выпускников",
    organization: { name: "-", responsible: "-", position: "-", additional: "-" },
    occupied: "да",
    actions: [{ type: "edit", src: "/img/edit.png" }, { type: "delete", src: "/img/delete.png" }]
  },
  {
    theme: "Разработка информационной системы сбора и мониторинга данных для зеленой станции СФУ",
    organization: { name: "-", responsible: "-", position: "-", additional: "-" },
    occupied: "нет",
    actions: [{ type: "edit", src: "/img/edit.png" }, { type: "delete", src: "/img/delete.png" }]
  },
  {
    theme: "Разработка информационной системы для автошколы СФУ",
    organization: { name: "-", responsible: "-", position: "-", additional: "-" },
    occupied: "нет",
    actions: [{ type: "edit", src: "/img/edit.png" }, { type: "delete", src: "/img/delete.png" }]
  },
  {
    theme: "Разработка приложения на основе искусственного интеллекта в сфере создания музыки",
    organization: { name: "-", responsible: "-", position: "-", additional: "-" },
    occupied: "нет",
    actions: [{ type: "edit", src: "/img/edit.png" }, { type: "delete", src: "/img/delete.png" }]
  },
];




export const router = createBrowserRouter([
  {
    element: <App />,
    children: [
      { path: "/profile_student", element: <ProfileStudent /> },
      { path: "/profile_teacher", element: <ProfileTeacher tableData={tableData} /> },
      { path: "/edit_student_profile", element: <EditStudentPage /> },
      { path: "/edit_teacher_profile", element: <EditTeacherPage /> },
      { path: "/", element: <Authentication /> },
      { path: "/choose_teacher", element: <ChooseTeacher /> },
      { path: "/create_request", element: <CreateRequest /> },
      { path: "/generate_application", element: <GenerateApplicaton /> },
      { path: "/method_recommendations", element: <MethodRecommendations /> },
      { path: "/form_marks_completion", element: <FormMarksCompletion /> },
      { path: "/edit_theme_list_teacher", element: <EditThemeListTeacher tableData={tableData}/> },
    ]
  },
]);
